import React from 'react';
import styles from './Modal.module.scss';
const Modal = ({ opened, setOpen }) => {
	return (
		<div
			onClick={(e) => {
				e.stopPropagation();
				setOpen(false);
			}}
			className={styles.overlay}
		>
			<div className={styles.modal}>
				<h2>Редактирование записи.</h2>
			</div>
		</div>
	);
};

export default Modal;
